import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';

const AdminDashboard = () => {
  const [responses, setResponses] = useState([]);
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [file, setFile] = useState(null);
  const [uploadError, setUploadError] = useState('');
  const history = useHistory();

  useEffect(() => {
    const token = localStorage.getItem('adminToken');
    if (!token) {
      history.push('/admin/login');
      return;
    }

    const fetchData = async () => {
      try {
        // Setup axios headers with token
        const config = {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        };

        // Fetch responses and stats in parallel
        const [responsesRes, statsRes] = await Promise.all([
          axios.get('/api/admin/responses', config),
          axios.get('/api/admin/stats', config)
        ]);

        setResponses(responsesRes.data);
        setStats(statsRes.data);
      } catch (err) {
        if (err.response?.status === 401) {
          localStorage.removeItem('adminToken');
          history.push('/admin/login');
        } else {
          setError('Error fetching data. Please try again later.');
        }
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [history]);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setUploadError('');
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    
    if (!file) {
      setUploadError('Please select a file to upload');
      return;
    }

    const formData = new FormData();
    formData.append('file', file);

    try {
      const token = localStorage.getItem('adminToken');
      
      await axios.post('/api/admin/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          'Authorization': `Bearer ${token}`
        }
      });

      alert('Survey file uploaded successfully');
      setFile(null);
      // Reset the file input
      document.getElementById('survey-file').value = '';
    } catch (err) {
      setUploadError(err.response?.data?.error || 'Error uploading file');
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('adminToken');
    history.push('/admin/login');
  };

  const downloadResponse = async (id) => {
    try {
      const token = localStorage.getItem('adminToken');
      
      window.open(`/api/admin/responses/${id}?token=${token}`, '_blank');
    } catch (err) {
      alert('Error downloading response');
    }
  };

  if (loading) {
    return <div className="loading">Loading dashboard...</div>;
  }

  return (
    <div className="admin-dashboard">
      <header className="dashboard-header">
        <h1>Survey Admin Dashboard</h1>
        <button onClick={handleLogout} className="logout-button">Logout</button>
      </header>

      {error && <div className="error-message">{error}</div>}

      <div className="dashboard-grid">
        <section className="stats-section">
          <h2>Statistics</h2>
          {stats && (
            <div className="stats-container">
              <div className="stat-card">
                <h3>Total Responses</h3>
                <p className="stat-value">{stats.totalResponses}</p>
              </div>
              <div className="stat-card">
                <h3>Total Answers</h3>
                <p className="stat-value">{stats.totalAnswers}</p>
              </div>
              <div className="stat-card">
                <h3>Avg. Answers Per Response</h3>
                <p className="stat-value">{stats.averageAnswersPerResponse.toFixed(2)}</p>
              </div>
            </div>
          )}
        </section>

        <section className="upload-section">
          <h2>Upload Survey</h2>
          <form onSubmit={handleUpload} className="upload-form">
            <div className="form-group">
              <label htmlFor="survey-file">XML Survey File</label>
              <input
                type="file"
                id="survey-file"
                accept=".xml"
                onChange={handleFileChange}
              />
            </div>
            {uploadError && <div className="error-message">{uploadError}</div>}
            <button type="submit" className="upload-button">Upload</button>
          </form>
        </section>

        <section className="responses-section">
          <h2>Survey Responses</h2>
          {responses.length === 0 ? (
            <p>No responses yet.</p>
          ) : (
            <table className="responses-table">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Date</th>
                  <th>Answers</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {responses.map(response => (
                  <tr key={response.id}>
                    <td>{response.id}</td>
                    <td>{new Date(response.startTime).toLocaleString()}</td>
                    <td>{response.answersCount}</td>
                    <td>
                      <button 
                        onClick={() => downloadResponse(response.id)}
                        className="download-button"
                      >
                        Download
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </section>
      </div>
    </div>
  );
};

export default AdminDashboard;
